import React, { useEffect, useState } from 'react';

// Helper component for Pie Chart
const PieChart = ({ occupiedPercentage, remainingPercentage, totalSpace, remainingSpace }) => (
  <div className="bg-white p-4 shadow rounded">
    <h3 className="text-xl font-semibold mb-2">Space Usage</h3>
    <div className="flex justify-center items-center">
      <div className="relative w-64 h-64">
        <svg viewBox="0 0 32 32" className="w-full h-full">
          <circle
            cx="16"
            cy="16"
            r="15.91549431"
            stroke="#FF6384"
            strokeWidth="7"
            strokeDasharray={`${occupiedPercentage} ${100 - occupiedPercentage}`}
            strokeLinecap="round"
            fill="none"
          />
          <circle
            cx="16"
            cy="16"
            r="15.91549431"
            stroke="#36A2EB"
            strokeWidth="7"
            strokeDasharray={`${remainingPercentage} ${100 - remainingPercentage}`}
            strokeLinecap="round"
            fill="none"
            strokeDashoffset={`${100 - occupiedPercentage}`}
          />
          <text
            x="50%"
            y="50%"
            textAnchor="middle"
            dy=".3em"
            fontSize="1.5em"
            fill="#333"
          >
            {remainingSpace} / {totalSpace}
          </text>
        </svg>
      </div>
    </div>
  </div>
);

// Helper component for Bar Chart
const BarChart = ({ products, totalSpace }) => (
  <div className="bg-white p-4 shadow rounded">
    <h3 className="text-xl font-semibold mb-2">Products and Space Usage</h3>
    <div className="w-full">
      {products.map(product => (
        <div key={product.item_name} className="flex items-center mb-2">
          <div className="w-1/4 font-semibold">{product.item_name}</div>
          <div className="w-3/4 bg-gray-200 rounded h-4 relative">
            <div
              className="absolute top-0 left-0 bg-blue-500 h-full rounded"
              style={{ width: `${(product.space_occupied / totalSpace) * 100}%` }}
            />
            <div className="absolute inset-0 flex items-center justify-center text-white">
              {product.space_occupied} units
            </div>
          </div>
        </div>
      ))}
    </div>
  </div>
);

const WarehouseSpace = () => {
  const [data, setData] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    // Fetch data from API
    fetch('http://localhost:5000/api/healthcare')
      .then(response => response.json())
      .then(data => setData(data))
      .catch(error => {
        console.error('Error fetching data:', error);
        setError('Error fetching data.');
      });
  }, []);

  if (error) return <div className="text-red-500">{error}</div>;
  if (!data) return <div>Loading...</div>;

  const { totalSpace, occupiedSpace, remainingSpace, products } = data;

  const occupiedPercentage = (occupiedSpace / totalSpace) * 100;
  const remainingPercentage = (remainingSpace / totalSpace) * 100;

  return (
    <div className="container mx-auto p-4">
      <h2 className="text-2xl font-bold mb-4">Warehouse Space Overview</h2>
      <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
        <PieChart
          occupiedPercentage={occupiedPercentage}
          remainingPercentage={remainingPercentage}
          totalSpace={totalSpace}
          remainingSpace={remainingSpace}
        />
        <BarChart
          products={products}
          totalSpace={totalSpace}
        />
      </div>
    </div>
  );
};

export default WarehouseSpace;
